def main_loop(gd: GameDisplay) -> None:
    index = 0
    frame_list = actual
    frame_name = "ACTUAL"
    while True:
        # Get input
        key_clicked = gd.get_key_clicked()
        # Change to previous frame
        if key_clicked == 'Left' and index > 0:
            index -= 1
        # Change to next frame
        elif key_clicked == 'Right' and index < len(frame_list) - 1:
            index += 1
        # Change to actual expected frame
        elif key_clicked == 'Up':
            frame_list = expected
            frame_name = "EXPECTED"
        # Change to actual frame
        elif key_clicked == 'Down':
            frame_list = actual
            frame_name = "ACTUAL"

        frame = frame_list[index][1]
        if key_clicked is not None:
            print(frame_name, "| FRAME:", index, " | ", frame)
        msg = str(index) + " " + frame_name
        gd.show_score(msg)
        draw_frame(gd, frame)
        gd.end_round()


def draw_frame(gd, frame):
    for item in frame.items():
        x, y = item[0]
        color = item[1]
        gd.draw_cell(x, y, color)
